"use strict";window.addEventListener("load",(async()=>{try{const t=await fetch("data.json"),e=await t.json(),n=["r","m","v","vi"];for(let t=0;t<e.length;t++){const{icon:o,category:c,score:a}=e[t],d=`${n[t]}Img`,r=`${n[t]}Txt`,s=`${n[t]}Score`;document.getElementById(d).src=o,document.getElementById(r).textContent=c,document.getElementById(s).textContent=a.toString()}}catch(t){}}));